import React, { useState } from 'react';

type TimePeriod = 'day' | 'week' | 'month';
type BehaviorView = 'mood' | 'habits' | 'screen-time' | 'rewards';

interface MoodEntry {
  time: string;
  mood: number; // 1-10 scale
  energy: number;
  stress: number;
}

interface HabitEntry {
  name: string;
  completed: boolean;
  streak: number;
  target: number;
  color: string;
}

const BehaviorDopamineSection: React.FC = () => {
  const [activePeriod, setActivePeriod] = useState<TimePeriod>('week');
  const [activeView, setActiveView] = useState<BehaviorView>('mood');

  // Sample data
  const todaysMood: MoodEntry[] = [
    { time: '8 AM', mood: 7, energy: 6, stress: 3 },
    { time: '12 PM', mood: 8, energy: 8, stress: 4 },
    { time: '4 PM', mood: 6, energy: 5, stress: 6 },
    { time: '8 PM', mood: 7, energy: 6, stress: 4 }
  ];

  const habits: HabitEntry[] = [
    { name: 'Morning Meditation', completed: true, streak: 12, target: 7, color: '#6366f1' },
    { name: 'Reading 30min', completed: true, streak: 8, target: 7, color: '#10b981' },
    { name: 'No Social Media Before Noon', completed: false, streak: 0, target: 7, color: '#f59e0b' },
    { name: 'Evening Walk', completed: true, streak: 5, target: 7, color: '#ef4444' },
    { name: 'Gratitude Journal', completed: false, streak: 0, target: 7, color: '#8b5cf6' }
  ];

  const screenTimeToday = {
    total: 6.2, // hours
    productive: 3.8,
    social: 1.2,
    entertainment: 1.2,
    goal: 5.0
  };

  return (
    <div className="section-card">
      <div className="section-title">
        <h3>🧠 Behavior & Dopamine</h3>
        <div style={{ display: 'flex', gap: '8px' }}>
          <button 
            className={`btn btn--pill ${activePeriod === 'day' ? 'btn-tab--active' : 'btn-tab'}`}
            onClick={() => setActivePeriod('day')}
          >
            Day
          </button>
          <button 
            className={`btn btn--pill ${activePeriod === 'week' ? 'btn-tab--active' : 'btn-tab'}`}
            onClick={() => setActivePeriod('week')}
          >
            Week
          </button>
          <button 
            className={`btn btn--pill ${activePeriod === 'month' ? 'btn-tab--active' : 'btn-tab'}`}
            onClick={() => setActivePeriod('month')}
          >
            Month
          </button>
        </div>
      </div>

      {/* View Selector */}
      <div style={{ 
        display: 'flex', 
        gap: '8px', 
        marginBottom: '16px',
        flexWrap: 'wrap'
      }}>
        <button 
          className={`btn btn--sm ${activeView === 'mood' ? 'btn--primary' : 'btn--secondary'}`}
          onClick={() => setActiveView('mood')}
        >
          Mood & Energy
        </button>
        <button 
          className={`btn btn--sm ${activeView === 'habits' ? 'btn--primary' : 'btn--secondary'}`}
          onClick={() => setActiveView('habits')}
        >
          Habit Tracking
        </button>
        <button 
          className={`btn btn--sm ${activeView === 'screen-time' ? 'btn--primary' : 'btn--secondary'}`}
          onClick={() => setActiveView('screen-time')}
        >
          Screen Time
        </button>
        <button 
          className={`btn btn--sm ${activeView === 'rewards' ? 'btn--primary' : 'btn--secondary'}`}
          onClick={() => setActiveView('rewards')}
        >
          Reward Score
        </button>
      </div>

      <div className="chart-row">
        <div className="chart-box">
          {activeView === 'mood' && (
            <div style={{ height: '220px', padding: '16px' }}>
              <h4 style={{ margin: '0 0 16px 0', fontSize: '14px', color: '#374151' }}>
                Today's Mood & Energy Tracking
              </h4>
              
              {/* Mood timeline chart */}
              <div style={{ 
                position: 'relative', 
                width: '100%', 
                height: '140px', 
                backgroundColor: '#f8fafc',
                borderRadius: '8px',
                border: '1px solid #e2e8f0',
                padding: '12px'
              }}>
                {/* Y-axis labels */}
                <div style={{ 
                  position: 'absolute', 
                  left: '8px', 
                  top: '20px', 
                  display: 'flex', 
                  flexDirection: 'column-reverse',
                  height: '100px',
                  justifyContent: 'space-between'
                }}>
                  {[10, 8, 6, 4, 2].map(val => (
                    <span key={val} style={{ fontSize: '10px', color: '#64748b' }}>{val}</span>
                  ))}
                </div>

                {/* Chart area */}
                <div style={{ 
                  marginLeft: '24px', 
                  height: '100px', 
                  position: 'relative',
                  display: 'flex',
                  alignItems: 'end',
                  justifyContent: 'space-between'
                }}>
                  {todaysMood.map((entry, index) => (
                    <div key={index} style={{ 
                      display: 'flex', 
                      flexDirection: 'column',
                      alignItems: 'center',
                      position: 'relative',
                      flex: 1
                    }}>
                      {/* Mood bar */}
                      <div style={{
                        width: '12px',
                        height: `${entry.mood * 8}px`,
                        backgroundColor: '#6366f1',
                        borderRadius: '2px',
                        marginBottom: '4px'
                      }} />
                      
                      {/* Energy bar */}
                      <div style={{
                        width: '12px',
                        height: `${entry.energy * 8}px`,
                        backgroundColor: '#10b981',
                        borderRadius: '2px',
                        marginBottom: '4px'
                      }} />

                      {/* Stress indicator (inverted) */}
                      <div style={{
                        width: '8px',
                        height: `${entry.stress * 4}px`,
                        backgroundColor: '#ef4444',
                        borderRadius: '2px',
                        marginBottom: '8px'
                      }} />

                      <span style={{ fontSize: '9px', color: '#64748b' }}>
                        {entry.time}
                      </span>
                    </div>
                  ))}
                </div>

                {/* Legend */}
                <div style={{ 
                  position: 'absolute',
                  bottom: '8px',
                  right: '8px',
                  display: 'flex',
                  gap: '8px',
                  fontSize: '9px'
                }}>
                  <div style={{ display: 'flex', alignItems: 'center', gap: '2px' }}>
                    <div style={{ width: '8px', height: '8px', backgroundColor: '#6366f1', borderRadius: '2px' }} />
                    <span>Mood</span>
                  </div>
                  <div style={{ display: 'flex', alignItems: 'center', gap: '2px' }}>
                    <div style={{ width: '8px', height: '8px', backgroundColor: '#10b981', borderRadius: '2px' }} />
                    <span>Energy</span>
                  </div>
                  <div style={{ display: 'flex', alignItems: 'center', gap: '2px' }}>
                    <div style={{ width: '8px', height: '8px', backgroundColor: '#ef4444', borderRadius: '2px' }} />
                    <span>Stress</span>
                  </div>
                </div>
              </div>

              <div style={{ 
                marginTop: '12px',
                padding: '8px',
                backgroundColor: '#f0fdf4',
                borderRadius: '6px',
                border: '1px solid #bbf7d0'
              }}>
                <p style={{ 
                  margin: 0, 
                  fontSize: '11px', 
                  color: '#15803d'
                }}>
                  💡 Pattern: Your energy peaks after lunch and correlates with morning meditation
                </p>
              </div>
            </div>
          )}

          {activeView === 'habits' && (
            <div style={{ height: '220px', padding: '16px' }}>
              <h4 style={{ margin: '0 0 16px 0', fontSize: '14px', color: '#374151' }}>
                Daily Habits Progress
              </h4>
              
              <div style={{ display: 'flex', flexDirection: 'column', gap: '8px' }}>
                {habits.map((habit, index) => (
                  <div key={index} style={{
                    display: 'flex',
                    alignItems: 'center',
                    gap: '8px',
                    padding: '8px',
                    backgroundColor: habit.completed ? '#f0fdf4' : '#fef2f2',
                    borderRadius: '6px',
                    border: `1px solid ${habit.completed ? '#bbf7d0' : '#fecaca'}`
                  }}>
                    {/* Completion checkbox */}
                    <div style={{
                      width: '16px',
                      height: '16px',
                      borderRadius: '3px',
                      backgroundColor: habit.completed ? habit.color : 'white',
                      border: `2px solid ${habit.color}`,
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'center',
                      fontSize: '10px',
                      color: 'white',
                      fontWeight: 'bold'
                    }}>
                      {habit.completed && '✓'}
                    </div>

                    {/* Habit name */}
                    <div style={{ flex: 1 }}>
                      <div style={{ 
                        fontSize: '12px', 
                        fontWeight: habit.completed ? 'bold' : 'normal',
                        color: habit.completed ? '#15803d' : '#dc2626'
                      }}>
                        {habit.name}
                      </div>
                    </div>

                    {/* Streak indicator */}
                    <div style={{ textAlign: 'right' }}>
                      <div style={{ fontSize: '12px', fontWeight: 'bold', color: habit.color }}>
                        {habit.streak}/{habit.target}
                      </div>
                      <div style={{ fontSize: '9px', color: '#64748b' }}>
                        streak
                      </div>
                    </div>
                  </div>
                ))}
              </div>

              <div style={{ 
                marginTop: '12px',
                display: 'flex',
                justifyContent: 'space-between',
                padding: '8px',
                backgroundColor: '#fef3c7',
                borderRadius: '6px',
                border: '1px solid #fbbf24'
              }}>
                <span style={{ fontSize: '11px', color: '#92400e' }}>
                  Today: {habits.filter(h => h.completed).length}/{habits.length} completed
                </span>
                <span style={{ fontSize: '11px', fontWeight: 'bold', color: '#92400e' }}>
                  {Math.round((habits.filter(h => h.completed).length / habits.length) * 100)}%
                </span>
              </div>
            </div>
          )}

          {activeView === 'screen-time' && (
            <div style={{ height: '220px', padding: '16px' }}>
              <h4 style={{ margin: '0 0 16px 0', fontSize: '14px', color: '#374151' }}>
                Screen Time Breakdown (Today)
              </h4>
              
              {/* Screen time donut chart simulation */}
              <div style={{ 
                display: 'flex', 
                justifyContent: 'center', 
                alignItems: 'center',
                height: '120px'
              }}>
                <div style={{ position: 'relative', width: '100px', height: '100px' }}>
                  <svg width="100" height="100" style={{ transform: 'rotate(-90deg)' }}>
                    {/* Background circle */}
                    <circle
                      cx="50"
                      cy="50"
                      r="40"
                      fill="none"
                      stroke="#f1f5f9"
                      strokeWidth="12"
                    />
                    {/* Productive time (61% of circle) */}
                    <circle
                      cx="50"
                      cy="50"
                      r="40"
                      fill="none"
                      stroke="#10b981"
                      strokeWidth="12"
                      strokeDasharray={`${2 * Math.PI * 40 * 0.61} ${2 * Math.PI * 40 * 0.39}`}
                      strokeDashoffset="0"
                    />
                    {/* Social media (19% of circle) */}
                    <circle
                      cx="50"
                      cy="50"
                      r="40"
                      fill="none"
                      stroke="#f59e0b"
                      strokeWidth="12"
                      strokeDasharray={`${2 * Math.PI * 40 * 0.19} ${2 * Math.PI * 40 * 0.81}`}
                      strokeDashoffset={`-${2 * Math.PI * 40 * 0.61}`}
                    />
                    {/* Entertainment (19% of circle) */}
                    <circle
                      cx="50"
                      cy="50"
                      r="40"
                      fill="none"
                      stroke="#ef4444"
                      strokeWidth="12"
                      strokeDasharray={`${2 * Math.PI * 40 * 0.19} ${2 * Math.PI * 40 * 0.81}`}
                      strokeDashoffset={`-${2 * Math.PI * 40 * 0.8}`}
                    />
                  </svg>
                  <div style={{
                    position: 'absolute',
                    top: '50%',
                    left: '50%',
                    transform: 'translate(-50%, -50%)',
                    textAlign: 'center'
                  }}>
                    <div style={{ fontSize: '16px', fontWeight: 'bold', color: '#374151' }}>
                      {screenTimeToday.total}h
                    </div>
                    <div style={{ fontSize: '9px', color: '#64748b' }}>
                      total
                    </div>
                  </div>
                </div>
              </div>

              {/* Breakdown */}
              <div style={{ 
                display: 'flex', 
                flexDirection: 'column',
                gap: '4px',
                marginTop: '16px'
              }}>
                {[
                  { label: 'Productive', value: screenTimeToday.productive, color: '#10b981' },
                  { label: 'Social Media', value: screenTimeToday.social, color: '#f59e0b' },
                  { label: 'Entertainment', value: screenTimeToday.entertainment, color: '#ef4444' }
                ].map((item, index) => (
                  <div key={index} style={{ 
                    display: 'flex', 
                    justifyContent: 'space-between',
                    alignItems: 'center',
                    fontSize: '12px'
                  }}>
                    <div style={{ display: 'flex', alignItems: 'center', gap: '6px' }}>
                      <div style={{ 
                        width: '8px', 
                        height: '8px', 
                        backgroundColor: item.color, 
                        borderRadius: '2px' 
                      }} />
                      <span style={{ color: '#64748b' }}>{item.label}</span>
                    </div>
                    <span style={{ fontWeight: 'bold', color: '#374151' }}>
                      {item.value}h
                    </span>
                  </div>
                ))}
              </div>

              <div style={{ 
                marginTop: '12px',
                padding: '8px',
                backgroundColor: screenTimeToday.total > screenTimeToday.goal ? '#fef2f2' : '#f0fdf4',
                borderRadius: '6px',
                border: `1px solid ${screenTimeToday.total > screenTimeToday.goal ? '#fecaca' : '#bbf7d0'}`
              }}>
                <p style={{ 
                  margin: 0, 
                  fontSize: '11px', 
                  color: screenTimeToday.total > screenTimeToday.goal ? '#dc2626' : '#15803d'
                }}>
                  {screenTimeToday.total > screenTimeToday.goal ? '⚠️' : '✅'} 
                  {' '}Goal: {screenTimeToday.goal}h | Current: {screenTimeToday.total}h
                </p>
              </div>
            </div>
          )}

          {activeView === 'rewards' && (
            <div style={{ height: '220px', padding: '16px' }}>
              <h4 style={{ margin: '0 0 16px 0', fontSize: '14px', color: '#374151' }}>
                Daily Dopamine Reward Score
              </h4>
              
              {/* Reward score gauge */}
              <div style={{ 
                display: 'flex', 
                justifyContent: 'center', 
                alignItems: 'center',
                height: '100px'
              }}>
                <div style={{ position: 'relative', width: '120px', height: '60px', overflow: 'hidden' }}>
                  <svg width="120" height="60">
                    {/* Background arc */}
                    <path
                      d="M 10 50 A 40 40 0 0 1 110 50"
                      fill="none"
                      stroke="#e2e8f0"
                      strokeWidth="8"
                    />
                    {/* Progress arc (75% = good day) */}
                    <path
                      d="M 10 50 A 40 40 0 0 1 85 20"
                      fill="none"
                      stroke="#10b981"
                      strokeWidth="8"
                      strokeLinecap="round"
                    />
                  </svg>
                  <div style={{
                    position: 'absolute',
                    bottom: '10px',
                    left: '50%',
                    transform: 'translateX(-50%)',
                    textAlign: 'center'
                  }}>
                    <div style={{ fontSize: '20px', fontWeight: 'bold', color: '#10b981' }}>
                      75
                    </div>
                    <div style={{ fontSize: '10px', color: '#64748b' }}>
                      reward score
                    </div>
                  </div>
                </div>
              </div>

              {/* Score breakdown */}
              <div style={{ 
                display: 'flex', 
                flexDirection: 'column',
                gap: '6px',
                marginTop: '16px'
              }}>
                {[
                  { activity: 'Completed Morning Routine', points: '+15', color: '#10b981' },
                  { activity: 'Exercise (30 min)', points: '+20', color: '#10b981' },
                  { activity: 'Healthy Meals', points: '+15', color: '#10b981' },
                  { activity: 'Social Media <2h', points: '+10', color: '#10b981' },
                  { activity: 'Reading Instead of TV', points: '+15', color: '#10b981' },
                  { activity: 'Impulse Purchase', points: '-5', color: '#ef4444' }
                ].map((item, index) => (
                  <div key={index} style={{ 
                    display: 'flex', 
                    justifyContent: 'space-between',
                    alignItems: 'center',
                    padding: '4px 8px',
                    backgroundColor: '#f8fafc',
                    borderRadius: '4px',
                    fontSize: '11px'
                  }}>
                    <span style={{ color: '#64748b' }}>{item.activity}</span>
                    <span style={{ 
                      fontWeight: 'bold', 
                      color: item.color,
                      fontSize: '12px'
                    }}>
                      {item.points}
                    </span>
                  </div>
                ))}
              </div>

              <div style={{ 
                marginTop: '8px',
                textAlign: 'center',
                fontSize: '10px',
                color: '#64748b'
              }}>
                Daily Average: 68 | Personal Best: 89
              </div>
            </div>
          )}
        </div>

        {/* Behavior Summary Cards */}
        <div className="metric-col">
          <div style={{ marginBottom: '16px' }}>
            <p className="card-title">Current Status</p>
            
            <div style={{ display: 'flex', alignItems: 'center', gap: '12px', marginTop: '12px' }}>
              <div style={{ textAlign: 'center' }}>
                <div style={{ fontSize: '24px', fontWeight: 'bold', color: '#10b981' }}>7.2</div>
                <div style={{ fontSize: '11px', color: '#64748b' }}>mood</div>
              </div>
              <div style={{ textAlign: 'center' }}>
                <div style={{ fontSize: '24px', fontWeight: 'bold', color: '#6366f1' }}>75</div>
                <div style={{ fontSize: '11px', color: '#64748b' }}>reward</div>
              </div>
            </div>

            {/* Weekly habit completion */}
            <div style={{ marginTop: '12px' }}>
              <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '4px' }}>
                <span style={{ fontSize: '12px', color: '#64748b' }}>Weekly Habits</span>
                <span style={{ fontSize: '11px', color: '#64748b' }}>5/7 days</span>
              </div>
              <div style={{ 
                width: '100%', 
                height: '6px', 
                backgroundColor: '#e2e8f0', 
                borderRadius: '3px',
                overflow: 'hidden'
              }}>
                <div style={{ 
                  width: '71%', 
                  height: '100%', 
                  backgroundColor: '#10b981',
                  borderRadius: '3px'
                }} />
              </div>
            </div>
          </div>

          <div style={{ marginBottom: '16px' }}>
            <p className="card-title">Dopamine Balance</p>
            <div style={{ display: 'flex', alignItems: 'baseline', gap: '8px', marginTop: '8px' }}>
              <h4 className="card-value">Balanced</h4>
              <span style={{ fontSize: '12px', color: '#059669', fontWeight: 500 }}>
                +5 vs yesterday
              </span>
            </div>
          </div>

          {/* Behavior Insight */}
          <div style={{ 
            padding: '12px', 
            backgroundColor: '#f0f9ff', 
            borderRadius: '8px',
            border: '1px solid #e0f2fe'
          }}>
            <p className="card-title" style={{ fontSize: '12px', marginBottom: '6px', color: '#0369a1' }}>
              🔍 Behavior Pattern
            </p>
            <p style={{ 
              margin: 0, 
              fontSize: '11px', 
              color: '#0369a1',
              lineHeight: '1.4'
            }}>
              Your mood improves consistently on days when you complete your morning routine by 9 AM.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default BehaviorDopamineSection;
